ST.xhtml:
SpecialVariablesPrg();
IF isFirstCycle THEN
   StartPrg();
   isFirstCycle := FALSE;
ELSE
   UserPrg();
END_IF;

// Update pulse bits
udiMicroAcc:= udiMicroAcc + Special_Variables.udiMainTaskInterval;
IF udiMicroAcc MOD 100000 >= 50000 THEN Pulse_100ms:= TRUE; ELSE Pulse_100ms:= FALSE; END_IF
IF udiMicroAcc MOD 500000 >= 250000 THEN Pulse_500ms:= TRUE; ELSE Pulse_500ms:= FALSE; END_IF
IF udiMicroAcc MOD 1000000 >= 500000 THEN Pulse_1s:= TRUE; ELSE Pulse_1s:= FALSE; END_IF
IF udiMicroAcc MOD 2000000 >= 1000000 THEN Pulse_2s:= TRUE; ELSE Pulse_2s:= FALSE; END_IF
IF udiMicroAcc MOD 5000000 >= 2500000 THEN Pulse_5s:= TRUE; ELSE Pulse_5s:= FALSE; END_IF
IF udiMicroAcc MOD 10000000 >= 5000000 THEN Pulse_10s:= TRUE; ELSE Pulse_10s:= FALSE; END_IF
IF udiMicroAcc MOD 30000000 >= 15000000 THEN Pulse_30s:= TRUE; ELSE Pulse_30s:= FALSE; END_IF
IF udiMicroAcc MOD 60000000 >= 30000000 THEN Pulse_60s:= TRUE; ELSE Pulse_60s:= FALSE; END_IF
udiMicroAcc:= udiMicroAcc MOD 120000000;

// Update scan pulse
Pulse_Scan:= NOT Pulse_Scan;

// Update system time
GetDateAndTime(System_Time);

// Update Hour_Minute
Hour_Minute:= System_Time.byHours * 100 + System_Time.byMinutes;

// Update Day of Week
Day_Of_Week:= GetDayOfWeek();
